const Footer = () => {

    const onPrint = () => {
        this.window.print()
    }
    return (
        <div className="modal-footer">
           <button className="footer-btn" onClick={onPrint}  >Preview</button>
            <button className="footer-btn">Download</button>
        </div>
    )
}

export default Footer
